CREATE DEFINER=`4pet`@`%` PROCEDURE `USP_TVC12_GetReport_Today` ()  BEGIN
DECLARE check1 int DEFAULT 0;
SELECT COUNT(*) INTO check1
FROM REPORT
WHERE Date(Now()) = _Date;
IF check1 = 0 THEN
	INSERT INTO REPORT(_Date, TotalPrice) VALUES(NOW(), 0);
END IF;
SELECT * FROM REPORT
	WHERE Date(Now()) = _Date
    ORDER BY ID DESC
    LIMIT 1;
END$$

