CREATE DEFINER=`4pet`@`%` PROCEDURE `USP_UpdateFood` (`id` INT(11), `name` VARCHAR(100), `price` DOUBLE, `idCategory` INT(11), `image` LONGTEXT)  BEGIN
	DECLARE idImageDelete, idImage int ;
    
    SELECT FOOD.IDImage into idImageDelete
    FROM FOOD
